                readonly errors: [{
                    readonly name: "InvalidDid";
                }, {
                    readonly name: "InvalidContacts";
                }, {
                    readonly name: "TooManyContacts";
                }, {
                    readonly name: "InvalidToken";
                }, {
                    readonly name: "InternalError";
                }];
